// SPDX-License-Identifier: MIT
pragma solidity  ^0.6.0;
pragma experimental ABIEncoderV2;

contract Wallet{

    constructor(address[] memory _approvers, uint _quorum) public {
        approvers = _approvers;
        quorum = _quorum;
    }

    address[] public approvers;
    uint public quorum;
    uint public nextTransferId;
    mapping(address =>mapping(uint => bool)) public approvals; 
    struct Transfer{
        uint id;
        address payable to;
        uint amount;
        uint approvers;
        bool sent;
    }

    Transfer[] public transfers;

    function getApprovers() public view returns (address[] memory){
        return approvers;
    }

    function getTransfers() public view returns (Transfer[] memory){
        return transfers;
    }

    function createTransfer(address payable _to, uint _amount) public onlyApproved(){
        transfers.push(Transfer(transfers.length, _to, _amount, 0, false));
    }

    function approveTransfer(uint _id) public onlyApproved(){
        require(!transfers[_id].sent, 'transfer has already been sent');
        require(!approvals[msg.sender][_id], 'transfer already approved by this address');
        approvals[msg.sender][_id]=true;
        transfers[_id].approvers++;
        if(transfers[_id].approvers >= quorum){
            transfers[_id].sent = true;
            transfers[_id].to.transfer(transfers[_id].amount);
        }
    }

    modifier onlyApproved() {
        bool _approved = false;
        for(uint i=0; i<approvers.length; i++){
            if(approvers[i] == msg.sender){
                _approved = true;
            }
        }
        require(_approved, 'address not approved');
        _;
    }

    receive() external payable {}

}
